				},
				["init"] = {
					["custom"] = "-- Settings\n\n-- Number of ranks in Potent Kick\naura_env.pkRanks  = 4\n\n-- Spark colors\naura_env.sparkCol = {\n    [\"r\"] = 255,\n    [\"g\"] = 116,\n    [\"b\"] = 34,\n    [\"a\"] = 1\n}\n\n-- Do not edit past this line\n\naura_env.orientation = WeakAuras.regions[aura_env.id].region.orientation\n\nif aura_env.orientation == \"HORIZONTAL\" then\n    aura_env.point = \"LEFT\"\n    aura_env.offsetXMulti = 1\n    aura_env.offsetYMulti = 0\nelseif aura_env.orientation == \"HORIZONTAL_INVERSE\" then\n    aura_env.point = \"RIGHT\"\n    aura_env.offsetXMulti = -1\n    aura_env.offsetYMulti = 0\nend\n\nif aura_env.orientation == \"VERTICAL\" then\n    aura_env.point = \"TOP\"\n    aura_env.offsetXMulti = 0\n    aura_env.offsetYMulti = -1\nelseif aura_env.orientation == \"VERTICAL_INVERSE\" then\n    aura_env.point = \"BOTTOM\"\n    aura_env.offsetXMulti = 0\n    aura_env.offsetYMulti = 1\nend\n\nlocal bar = WeakAuras.regions[aura_env.id].region.bar\n\nbar.spark:SetVertexColor(\n    aura_env.sparkCol.r,\n    aura_env.sparkCol.g,\n    aura_env.sparkCol.b,\n    aura_env.sparkCol.a\n)\n\nfor i = 1,2 do\n    if not bar[\"spark\"..i] then\n        local spark = bar:CreateTexture(nil, \"ARTWORK\");\n        \n        spark:SetDrawLayer(\"ARTWORK\", 3);\n        bar[\"spark\"..i] = spark\n    end\n    \n    bar[\"spark\"..i]:SetTexture(bar.spark:GetTexture())\n    bar[\"spark\"..i]:SetWidth(bar.spark:GetWidth() - 1);\n    bar[\"spark\"..i]:SetHeight(bar.spark:GetHeight() - 12);\n    bar[\"spark\"..i]:SetBlendMode(bar.spark:GetBlendMode());\n    bar[\"spark\"..i]:SetVertexColor(\n        aura_env.sparkCol.r,\n        aura_env.sparkCol.g,\n        aura_env.sparkCol.b,\n        aura_env.sparkCol.a\n    )\nend",
