			["customText"] = "function()\n    -- Get the critChance\n    crit = GetCritChance()\n    \n    -- Getting the description of the spell to get the healing value\n    description = GetSpellDescription(idGift)..\"\"    \n    -- Cutting all text to only get the value\n    valByOrbs = tonumber(string.gsub(description, \"[^%d]\", \"\"),10)\n    \n    -- Average value for Overflow talent TO REMOVE IS THE COUNT IS ALREADY GOOD\n    averageValueOverflow = valByOrbs*(1-chanceForOverflow) + 2*valByOrbs*chanceForOverflow\n    \n    -- Every orbs can crit, even the overflow's orbs\n    averageCrit = averageValueOverflow*(1-crit/100)+2*averageValueOverflow*crit/100\n    \n    --Get the number of orbs currently available\n    nbOrbs = GetSpellCount(idExpel)\n    \n    spellHealing = nbOrbs*averageCrit\n    \n    --################################################################\n    -- Here, we will get the current health and the max health to know if we can trigger Expel Harm\n    --################################################################\n    \n    local percentTresh = 0.5\n    -- if the heal to do will not go in overheal we change de texture color\n    local region = WeakAuras.regions[aura_env.id].region\n    local HealthToHeal = UnitHealthMax(\"player\")-UnitHealth(\"player\")\n    \n    if(HealthToHeal > spellHealing*(1+percentTresh)) then\n        region:SetGlow(true)       -- BRILLE\n        region:Color(0,1,0)\n        \n    elseif(HealthToHeal > spellHealing) then\n        region:Color(0,1,0)       -- VERT\n        \n        \n    elseif(HealthToHeal < spellHealing) then\n        region:Color(1,0,0,0.5)   -- ROUGE\n        region:SetGlow(false)\n        \n    else \n        -- error(\"Cas non répertorier\")\n        \n    end\n    \n    return aura_env.shortenNumber(spellHealing)   \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["yOffset"] = 203.17647889869,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["customTextUpdate"] = "update",
			["url"] = "https://wago.io/ryAyq5tb7/77",
			["actions"] = {
				["start"] = {
					["do_glow"] = false,
					["glow_frame"] = "WeakAuras:Extraction du mal",
					["glow_action"] = "show",
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "--PUT HERE THE NUMBER of point in Overflow talent\nnbTalent = 4\nchanceForOverflow = nbTalent*5/100\n\n--Variables\ncrit = 20.5 --default critchance\nidGift = 124502 --Ox gift\nidExpel = 115072 --Expel Harm iD\ndescription = \"blablalba 123 456 balbal\" --test string for description\nvalByOrbs = 0 -- Healing by orbs\nnbOrbs = 2 -- Number of orbs currently usable\naverageValueOverflow = 0 -- Overflow can \"proc\" offering one orbs who will heal double \naverageCrit = 0 --Healing on average crit chance take in consideration\nspellHealing = 0\n\n\n\n-- ######################################################\n--   Function made by Hamsda https://wago.io/NJKRRlT9W\n-- ######################################################\naura_env.shortenNumber = function(number)\n    local affixes = {\n        \"\",\n        \"k\",\n        \"m\",\n        \"b\",\n    }\n    \n    local affix = 1\n    local dec = 0\n    local num1 = math.abs(number)\n    while num1 >= 1000 and affix < #affixes do\n        num1 = num1 / 1000\n        affix = affix + 1\n    end\n    if affix > 1 then\n        dec = 2\n        local num2 = num1\n        while num2 >= 10 do\n            num2 = num2 / 10\n            dec = dec - 1\n        end\n    end\n    if number < 0 then\n        num1 = -num1\n    end\n    \n    return string.format(\"%.\"..dec..\"f\"..affixes[affix], num1)\nend\n\n\n",
					["do_custom"] = true,
				},
			},
