			},
			["displayText"] = "%c",
			["customText"] = "function()\n    if aura_env.name then\n        WeakAuras.regionPrototype.SetTextOnText(aura_env.region.text2, aura_env.count)\n        return aura_env.name\n    end\nend\n\n\n\n\n",
			["yOffset"] = 376.99999545482,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["customTextUpdate"] = "update",
			["cooldownEdge"] = false,
			["actions"] = {
				["start"] = {
					["custom"] = "\n\n\n\n\n\n\n\n\n\n\n\n\n",
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "aura_env.hideFrame = nil\n\naura_env.LCG = LibStub(\"LibCustomGlow-1.0\")\n\naura_env.frameTable = {}\n-- Send this function a group/raid member's unitID or GUID and it will return their raid frame.\nfunction aura_env.GetFrame(target)\n    if not UnitExists(target) then\n        if type(target) == \"string\" and target:find(\"Player\") then\n            target = select(6,GetPlayerInfoByGUID(target))\n        else\n            return \n        end\n    end \n    --PitBull4\n    if IsAddOnLoaded(\"PitBull4\") then\n        if IsInGroup() and not IsInRaid() then\n            for _,frame in pairs(PitBull4.all_frames_list) do\n                if frame.classification == \"Party\" and frame.unit then\n                    return frame                \n                end\n            end\n        end\n    end\n    --ShadowUF\n    if IsAddOnLoaded(\"ShadowedUnitFrames\") then\n        local unittype = nil\n        local path = nil\n        if (IsInRaid() and ShadowUF.enabledUnits.raid)\n        or (not IsInRaid() and IsInGroup() and ShadowUF.db.profile.units.raid.showParty and ShadowUF.enabledUnits.raid) -- show party as raid\n        then\n            unittype = \"raid\"\n            path = ShadowUF.Units.headerFrames.raid\n        else \n            if IsInGroup() and not IsInRaid() and ShadowUF.enabledUnits.party then\n                unittype = \"party\"\n                path = ShadowUF.Units.headerFrames.party\n            end\n        end\n        \n        if unittype and path then\n            for _,frame in pairs(path) do\n                if type(frame) == \"table\" \n                and frame.unitType == unittype\n                and frame:IsVisible() \n                and frame.unit \n                and UnitIsUnit(frame.unit, target)\n                then\n                    return frame\n                end\n            end\n        end\n    end\n    -- CompactRaid\n    if IsAddOnLoaded(\"CompactRaid\") then\n        return CompactRaid:FindUnitFrame(target)\n    end\n    -- Healbot\n    if IsAddOnLoaded(\"HealBot\") then\n        for _,frame in pairs(HealBot_Unit_Button) do\n            if UnitIsUnit(frame.unit, target) then\n                return frame\n            end\n        end\n    end\n    --Vuhdo\n    if IsAddOnLoaded(\"VuhDo\") and VUHDO_CONFIG[\"SHOW_PANELS\"] then\n        for _, v in pairs(VUHDO_UNIT_BUTTONS) do\n            if v[1].raidid and UnitIsUnit(v[1].raidid, target) then\n                return v[1]\n            end \n        end\n    end\n    -- Grid\n    if IsAddOnLoaded(\"Grid\") then\n        for _, frame in pairs(Grid.modules.GridFrame.registeredFrames) do\n            if frame:IsVisible() then\n                if frame.unit and UnitIsUnit(frame.unit, target) then\n                    return frame\n                end\n            end\n        end\n    end\n    --Grid2\n    if IsAddOnLoaded(\"Grid2\") then\n        for _, frame in pairs(Grid2Frame.registeredFrames) do\n            if frame:IsVisible() then\n                if frame.unit and UnitIsUnit(frame.unit, target) then\n                    return frame\n                end\n            end\n        end\n    end\n    -- ElvUI\n    if ElvUF then\n        for _,frame in pairs(ElvUF.objects) do\n            if (frame.unitframeType == \"raid\" \n                or frame.unitframeType == \"party\" \n                or frame.unitframeType == \"raid40\"\n            )\n            and frame:IsVisible() and frame.unit and UnitIsUnit(frame.unit, target)\n            then\n                return frame.Health\n            end\n        end\n    end\n    -- bdGrid\n    if IsAddOnLoaded(\"bdGrid\") then\n        for _,frame in pairs(oUF_bdGridRaid) do\n            if UnitIsUnit(frame.unit, target) then\n                return frame\n            end\n        end\n    end\n    -- Lime Raid Frames\n    if IsAddOnLoaded(\"Lime\") then\n        for frame in pairs(Lime.visibleMembers) do\n            if frame:IsVisible() and UnitIsUnit(frame.displayedUnit, target) then\n                return frame\n            end\n        end\n    end\n    --Lastly, default frames\n    if IsInRaid() then \n        if CompactRaidFrameContainer.groupMode == \"flush\" then\n            return CompactRaidFrameContainer_GetUnitFrame(CompactRaidFrameContainer, target, \"raid\")\n        else\n            for i = 1,8 do\n                for j = 1,5 do\n                    local frame = _G[\"CompactRaidGroup\"..i..\"Member\"..j]\n                    if frame\n                    and frame:IsVisible()\n                    and frame.unit\n                    and UnitIsUnit(frame.unit, target)\n                    then\n                        return frame\n                    end\n                end\n            end\n        end\n    elseif IsInGroup() and GetCVarBool(\"useCompactPartyFrames\") then\n        if CompactRaidFrameContainer.groupMode == \"flush\" then\n            return CompactRaidFrameContainer_GetUnitFrame(CompactRaidFrameContainer, target, \"raid\")\n        else\n            for i = 1,5 do\n                local frame = _G[\"CompactPartyFrameMember\"..i]\n                if frame\n                and frame:IsVisible()\n                and frame.unit\n                and UnitIsUnit(frame.unit, target)\n                then\n                    return frame\n                end\n            end\n        end\n    else\n        -- Player Frame\n        local frame = PlayerFrame\n        if frame \n        and frame:IsVisible() \n        and frame.unit \n        and UnitIsUnit(frame.unit, target) then\n            return frame\n        end\n        -- Default party frames\n        for i = 1,4 do\n            local frame = _G[\"PartyMemberFrame\"..i]\n            if frame\n            and frame:IsVisible()\n            and frame.unit\n            and UnitIsUnit(frame.unit, target)\n            then\n                return frame\n            end\n        end\n    end\nend",
					["do_custom"] = true,
				},
				["finish"] = {
					["custom"] = "if aura_env.hideFrame then\n    aura_env.LCG.PixelGlow_Stop(aura_env.hideFrame)\n    aura_env.hideFrame = nil\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
