				["init"] = {
					["custom"] = "-- Based on https://wago.io/By8pPJk47/28\n\naura_env.lastCheck = 0\nlocal _, class, _ = UnitClass(\"player\")\n\naura_env.auraID = 1459\n\n--Check if a specific unit needs one of the buffs\nfunction aura_env.UnitNeedsBuff(unit, id)\n    \n    if WA_GetUnitBuff(unit, id) then\n        \n        return false\n        \n    else\n        \n        local maxPower = UnitPowerMax(unit)\n        local powerType = UnitPowerType(unit)\n        \n        -- 8: Balance druid, 13: Shadow Priest\n        local caster = maxPower > 20000 or powerType == 8 or powerType == 13\n        \n        -- Mage buff\n        if not caster and id == 1459 then\n            \n            return false\n            \n        end\n        \n    end\n    \n    return true\n    \nend",
