						["custom"] = "function(e, timestamp,event,hideCaster,sourceGUID,sourceName,sourceFlags,sourceRaidF,destGUID,destName,destFlags,destRaidFlags,spellID,spellName)\n    \n    local time = GetTime()\n    \n    --Only check on aura specific events, otherwise once a second (reduces CPU load)\n    \n    if time - aura_env.lastCheck >= 1 \n    or spellID == aura_env.auraID \n    or e ~= \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        \n        aura_env.lastCheck = time\n        aura_env.trigger = false\n        \n        \n        --Check player for buff first (for glow)\n        aura_env.trigger = aura_env.UnitNeedsBuff(\"player\", aura_env.auraID)\n        -- aura_env.region:SetGlow(aura_env.trigger)\n        \n        \n        --Check members for buff if player has buff\n        if not aura_env.trigger then\n            \n            for unit in WA_IterateGroupMembers(false, false) do\n                \n                if UnitExists(unit) \n                and UnitIsPlayer(unit) \n                and UnitInRange(unit) \n                and not UnitIsDeadOrGhost(unit) then\n                    \n                    if aura_env.UnitNeedsBuff(unit, aura_env.auraID) then\n                        \n                        aura_env.trigger = true\n                        break\n                        \n                    end\n                    \n                end\n                \n            end\n            \n        end\n        \n    end\n    \n    return aura_env.trigger\n    \nend",
