						["use_specific_unit"] = false,
						["event"] = "Health",
						["unit"] = "group",
						["customDuration"] = "function()\n    if aura_env.expirationTime then\n        return aura_env.duration, aura_env.expirationTime\n    end\nend\n\n\n\n\n\n\n\n\n\n",
						["spellIds"] = {
							119611, -- [1]
						},
						["custom"] = "function()\n    local theTime = GetTime()\n    if not aura_env.last or aura_env.last < theTime - 0.5 then --throttle to 1 second\n        aura_env.last = theTime\n        aura_env.count = 0\n        aura_env.name, aura_env.duration, aura_env.expirationTime, aura_env.frame = \"\", nil, nil, nil\n        for unit in WA_IterateGroupMembers() do\n            local mist, _, _, _, duration, expirationTime, casterUID = WA_GetUnitBuff(unit, 119611)\n            if mist and UnitGUID(casterUID) == WeakAuras.myGUID then\n                aura_env.count = aura_env.count + 1\n                if not aura_env.expirationTime or expirationTime < aura_env.expirationTime then\n                    aura_env.name = RAID_CLASS_COLORS[select(2,UnitClass(unit))]:WrapTextInColorCode(UnitName(unit))\n                    aura_env.duration, aura_env.expirationTime, aura_env.frame = duration, expirationTime, unit\n                end\n            end\n        end\n        local frame = aura_env.GetFrame(aura_env.frame)\n        if frame and (frame ~= aura_env.hideFrame or not aura_env.hideFrame) then\n            if aura_env.hideFrame then aura_env.LCG.PixelGlow_Stop(aura_env.hideFrame) end\n            aura_env.hideFrame = frame\n            aura_env.LCG.PixelGlow_Start(\n                aura_env.region, --Frame\n                {0, 1, 1, 1}, --Color\n                10, --N of lines\n                0, --Frequency\n                0, --Length of lines\n                0, --Thickness of lines\n                0, --xOffset\n                0, --yOffset\n                true, --Border\n                nil --Key\n            )\n        end\n    end\n    return aura_env.duration\nend\n\n\n",
