						["customOverlay1"] = "-- Soul Shard Cost prediction\nfunction()\n    local shards = UnitPower(\"player\",7)\n    local spell = UnitCastingInfo(\"player\")\n    local _,_,_,_,_,_,spellID = GetSpellInfo(spell)\n    local cost = 0\n    \n    if spell and spellID then\n        local spellCost = GetSpellPowerCost(spellID)[1]\n        \n        if spellCost and spellCost.type == 7 then\n            if spellCost.cost > shards then\n                cost = shards\n            else\n                cost = spellCost.cost\n            end\n        end\n    end\n    \n    return \"backward\",cost\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
