						["unit"] = "player",
						["customDuration"] = "function()\n    if (aura_env.duration ~= 0) then\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(false)\n    else\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(true)\n    end\n    return aura_env.duration, aura_env.expires\nend",
						["customName"] = "function()\n    return aura_env.name\nend\n\n\n\n",
						["custom"] = "function()\n    local bloomName = GetSpellInfo(33763)\n    \n    local function findBloom(unit, bloom)\n        for i = 1, 40 do\n            --local name, _, _, _, dur, etime = UnitBuff(unit,i)\n            local   name,_,_,_,dur,etime,unitCaster = UnitBuff(unit,i)\n            if ( name == bloom  and unitCaster==\"player\") then\n                return true, dur, etime\n            end\n        end\n        return false\n    end\n    \n    local unit = (IsInRaid() and \"raid\") or ( IsInGroup() and \"party\" ) or \"player\"\n    \n    local loopCount = 1\n    local loopStart = 1\n    if ( unit ~= \"player\" ) then\n        loopCount = GetNumGroupMembers()\n        loopStart = 0\n    end\n    for i = loopStart, loopCount do\n        local unitID = \"player\"\n        if ( unit ~= \"player\" ) then\n            unitID = unit..i\n            if ( i == 0 ) then\n                unitID = \"player\"\n            end\n        end\n        local name = UnitName(unitID)\n        local found, dur, etime = findBloom(unitID, bloomName)\n        if ( found ) then\n            local class = select(2,UnitClass(unitID))\n            local colorText = RAID_CLASS_COLORS[class] and RAID_CLASS_COLORS[class].colorStr or \"ffbbbbbb\"\n            aura_env.name = \"|c\" .. colorText .. tostring(name) .. \"|r\"\n            aura_env.duration = dur\n            aura_env.expires = etime\n            return true\n        end\n    end\n    \n    aura_env.duration = 0\n    aura_env.expires = 0\n    aura_env.name = \"NO BLOOM!\"\n    return true\nend",
