				["start"] = {
				},
				["init"] = {
					["custom"] = "---------------------------------------------------\n--Demonic Consumption Forecaster & Demons Counter--\n---------------------------------------------------\n--Made by Kirihn-Area 52 -- DO NOT TOUCH ANYTHING--\n---------------------------------------------------\n\naura_env.CountOnlyImps = false\n\naura_env.baselineDemons = { --[demon] = duration (0 to blacklist)\n    [688] = 0,     --Imp\n    [697] = 0,     --Voidwalker\n    [691] = 0,     --Felhunter\n    [712] = 0,     --Succubus\n    [30146] = 0,   --Felguard\n    [112866] = 0,  --Fel Imp\n    [112867] = 0,  --Voidlord\n    [112869] = 0,  --Observer\n    [112868] = 0,  --Shivarra\n    [112870] = 0,  --Wrathguard\n    [240263] = 0,  --Fel Succubus\n    [240266] = 0,  --Shadow Succubus\n    [104317] = 0,  --Wild Imps, counted by other means\n    [111898] = 15, --Grimoire: Felguard\n    [193331] = 12, --Dreadstalker 1\n    [193332] = 12, --Dreadstalker 2\n    [265187] = 15, --Demonic Tyrant\n    [264119] = 15  --Vilefiend\n}\n\naura_env.count = 0\naura_env.demonicBag = {}\naura_env.ImpEnergy = {}\naura_env.ImpMaxCasts = 5\naura_env.ImpMaxTime = 20 --seconds\naura_env.randomDemonsDuration = 15 --seconds\naura_env.TyrantDuration = 15 --seconds\naura_env.TyrantStart = 0\naura_env.TyrantActive = false\n\nlocal TyrantBuffPerEnergy = 5 --%\n\naura_env.myGUID = UnitGUID(\"player\")\n\nfunction aura_env.UpdateCount()\n    aura_env.count = 0\n    \n    for k, v in pairs(aura_env.ImpEnergy) do\n        if k and v[1] > 0 then\n            aura_env.count = aura_env.count + 1\n        end\n    end\n    \n    if not aura_env.CountOnlyImps then\n        for k in pairs(aura_env.demonicBag) do\n            aura_env.count = aura_env.count + 1\n        end\n    end\nend\n\nfunction aura_env.UpdateBuff()\n    aura_env.Buff = 0\n    \n    if aura_env.ImpEnergy then\n        for k, v in pairs(aura_env.ImpEnergy) do\n            aura_env.Buff = aura_env.Buff + v[1]*TyrantBuffPerEnergy\n        end\n    end\nend\n\naura_env.UpdateBuff()\naura_env.UpdateCount()\n\nlocal r = aura_env.region\n\n--r.stacks:ClearAllPoints()\n--r.stacks:SetPoint(\"RIGHT\", r, \"BOTTOM\", 0.5*r.width, 0.075*r.height)\n\n--r.text2:ClearAllPoints()\n--r.text2:SetPoint(\"RIGHT\", r, \"TOP\", 0.5*r.width, -0.1*r.height)",
