			["triggers"] = {
				{
					["trigger"] = {
						["duration"] = "1",
						["genericShowOn"] = "showOnActive",
						["names"] = {
						},
						["debuffType"] = "HELPFUL",
						["type"] = "custom",
						["unevent"] = "timed",
						["custom"] = "function(event, ...)\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local _, subevent, _, sourceGUID, _, _, _, destGUID, destName, _, _, spellID = ... -- GetCombatLogCurrentEventInfo()\n        local e = aura_env\n        \n        --Imps are summoned\n        if subevent == \"SPELL_SUMMON\" and sourceGUID == e.myGUID and (spellID == 104317 or spellID == 279910) then \n            local tyrantExtra = e.TyrantActive and e.TyrantDuration - (GetTime() - e.TyrantStart) or 0\n            \n            e.ImpEnergy[destGUID] = {e.ImpMaxCasts, GetTime() + e.ImpMaxTime + tyrantExtra - 0.1}\n            \n            C_Timer.After(e.ImpMaxTime + tyrantExtra, function()\n                    \n                    for k in pairs(e.ImpEnergy) do\n                        if GetTime() > e.ImpEnergy[k][2] then\n                            e.ImpEnergy[k] = nil\n                        end\n                    end\n            end)\n            \n            --Other demons are summoned\n        elseif subevent == \"SPELL_SUMMON\" and sourceGUID == e.myGUID and not (spellID == 104317 or spellID == 279910) then\n            \n            if e.baselineDemons[spellID] and e.baselineDemons[spellID] > 0 then\n                e.demonicBag[destGUID] = GetTime() + e.baselineDemons[spellID] - 0.1\n                \n                C_Timer.After(e.baselineDemons[spellID], function()\n                        for k, v in pairs(e.demonicBag) do\n                            if GetTime() > v then\n                                e.demonicBag[k] = nil\n                            end\n                        end\n                end)\n                \n            elseif not e.baselineDemons[spellID] then\n                e.demonicBag[destGUID] = GetTime() + e.randomDemonsDuration - 0.1\n                \n                C_Timer.After(e.randomDemonsDuration, function()\n                        for k, v in pairs(e.demonicBag) do\n                            if GetTime() > v then\n                                e.demonicBag[k] = nil\n                            end\n                        end\n                end)\n            end\n        end\n        \n        --Imps succesfully consume energy\n        if subevent == \"SPELL_CAST_SUCCESS\" and e.ImpEnergy[sourceGUID] and not e.TyrantActive then\n            if e.ImpEnergy[sourceGUID][1] == 1 then\n                e.ImpEnergy[sourceGUID] = nil\n                \n            else\n                e.ImpEnergy[sourceGUID][1] = e.ImpEnergy[sourceGUID][1] - 1\n            end\n        end\n        \n        --Summon Demonic Tyrant\n        if subevent == \"SPELL_CAST_SUCCESS\" and sourceGUID == e.myGUID and spellID == 265187 then\n            local remains\n            \n            e.TyrantActive = true\n            e.TyrantStart = GetTime()\n            \n            if IsPlayerSpell(267215) then\n                table.wipe(e.ImpEnergy)\n            end\n            \n            C_Timer.After(e.TyrantDuration, function()\n                    e.TyrantActive = false\n                    \n                    for k in pairs(e.ImpEnergy) do\n                        if GetTime() > e.ImpEnergy[k][2] then\n                            e.ImpEnergy[k] = nil\n                        end\n                    end \n                    \n                    for k, v in pairs(e.demonicBag) do\n                        if GetTime() > v then\n                            e.demonicBag[k] = nil\n                        end\n                    end\n            end)\n            \n            for k in pairs(e.ImpEnergy) do\n                remains = e.ImpEnergy[k][2] - GetTime()\n                e.ImpEnergy[k][2] = e.ImpEnergy[k][2] + e.TyrantDuration - 0.1\n                \n                C_Timer.After(e.TyrantDuration + remains, function()\n                        for k in pairs(e.ImpEnergy) do\n                            if GetTime() > e.ImpEnergy[k][2] then\n                                e.ImpEnergy[k] = nil\n                            end\n                        end      \n                end)\n            end\n            \n            for k in pairs(e.demonicBag) do\n                remains = e.demonicBag[k] - GetTime()\n                e.demonicBag[k] = e.demonicBag[k] + e.TyrantDuration - 0.1\n                \n                C_Timer.After(e.TyrantDuration + remains, function()\n                        for k, v in pairs(e.demonicBag) do\n                            if GetTime() > v then\n                                e.demonicBag[k] = nil\n                            end\n                        end\n                end)\n            end\n        end\n        \n        --Implosion\n        if subevent == \"SPELL_CAST_SUCCESS\" and sourceGUID == e.myGUID and spellID == 196277 then\n            table.wipe(e.ImpEnergy)\n            e.UpdateBuff()\n        end\n        \n        --Power Siphon\n        if subevent == \"SPELL_CAST_SUCCESS\" and sourceGUID == e.myGUID and spellID == 264130 then\n            local oldest, oldestTime = \"\", 2*GetTime()\n            \n            for i = 1, 2 do\n                for name, imp in pairs(e.ImpEnergy) do\n                    oldestTime = math.min(imp[2], oldestTime)\n                    \n                    if imp[2] == oldestTime then\n                        oldest = name\n                    end\n                end\n                \n                oldestTime = oldestTime*2\n                \n                e.ImpEnergy[oldest] = nil\n            end\n        end\n        \n        --Death\n        if subevent == \"UNIT_DIED\" or subevent == \"SPELL_INSTAKILL\" or subevent == \"UNIT_DESTROYED\" then\n            if e.ImpEnergy[destGUID] then\n                e.ImpEnergy[destGUID] = nil\n                \n            elseif e.demonicBag[destGUID] then      \n                e.demonicBag[destGUID] = nil\n                \n            elseif destGUID == e.myGUID then\n                table.wipe(e.ImpEnergy)\n                table.wipe(e.demonicBag)\n            end\n        end\n    end\n    \n    return true\nend",
